import React from 'react';
import ReactDOM from 'react-dom';
class JSX extends React.Component {
  constructor(props) {
      super(props);
  }
  componentDidMount(){

  }
  render() {
    return (
      <>
      <h1 style={{color:'red'}}>Hello,wolrd</h1>
      <h1>{this.getTitle(0)}</h1>
      </>
    );
  }
  getTitle(t){
    let obj = ['hello world','hello friend'];
    return obj[t];

  }
}

export default JSX;
